function makeApiCall() {
  var params = {
    spreadsheetId: '1lFJT0h7L2p9Zj_qxozAqReDKMfJdmdqNHzqFXxkfDZM',
    range: 'Hotels',
  };

  var request = gapi.client.sheets.spreadsheets.values.get(params);
  request.then(function(response) {
    // TODO: Change code below to process the `response` object:
    populateSheet(response.result.values);
  }, function(reason) {
    console.error('error: ' + reason.result.error.message);
  });
}

function populateSheet(array){
  //console.log(array);
  let tbody = document.querySelector('#tbody');

  for(let row=2, i=0; row<array.length; row++, i++){

    let tr = document.createElement('tr');
    tr.setAttribute('id', i);
    let chbx = document.createElement('INPUT');
    chbx.setAttribute('type', 'checkbox');
    chbx.setAttribute('id', i);
    chbx.setAttribute('class', 'rows');

    for(let col=0; col<9; col++){
      //console.log(array[row][col]);
      let td = document.createElement('td');
      td.innerHTML = array[row][col];
      tr.append(td);

    }
    tr.append(chbx);
    tbody.append(tr);
  }
}

function createPdf(concierge) {
  console.log(concierge);

    (function(API){
      API.myText = function(txt, options, x, y) {
        options = options ||{};
        /* Use the options align property to specify desired text alignment
         * Param x will be ignored if desired text alignment is 'center'.
         * Usage of options can easily extend the function to apply different text
         * styles and sizes
        */
        if( options.align == "center" ){
            // Get current font size
            var fontSize = this.internal.getFontSize();

            // Get page width
            var pageWidth = this.internal.pageSize.width;

            // Get the actual text's width
            /* You multiply the unit width of your string by your font size and divide
             * by the internal scale factor. The division is necessary
             * for the case where you use units other than 'pt' in the constructor
             * of jsPDF.
            */
            txtWidth = this.getStringUnitWidth(txt)*fontSize/this.internal.scaleFactor;

            // Calculate text's x coordinate
            x = ( pageWidth - txtWidth ) / 2;
        }

        // Draw text at x,y
        this.text(txt,x,y);
    }
    })(jsPDF.API);
    // Default export is a4 paper, portrait, using milimeters for units
    //fields
    let booking = concierge[0];
    let hotel = concierge[1];
    let hotel_address = concierge[2];
    let guest = concierge[3];
    let check_in = concierge[4];
    let check_out = concierge[5];
    let nigths = concierge[6];
    let root_type = concierge[7];
    let info = concierge[8];


    var imgData = 'data:image/jpeg;base64,';



    var doc = new jsPDF("p", "mm", "legal");


    doc.addImage(imgData, 'JPEG', 0,0, 216, 356);

       var lMargin=67;
       var rMargin=60;
       var pdfInMM=216;
var lines = doc.splitTextToSize(hotel_address, (pdfInMM-lMargin-rMargin));
var lines1 = lines[0];
var lines2 = lines[1];
if(lines.length === 3){var lines3 = lines[2]}
else{var lines3 = ""};

var lines4 = "";
    doc.setFontType('bold')
    doc.setFontSize(22)
    doc.myText(hotel, {align: "center"},0,155);
    doc.setFontType('normal')
    doc.setFontSize(15)
    //doc.myText(hotel_address, {align: "center"},0,165);
    doc.myText(lines1, {align: "center"},0,165);
    doc.myText(lines2, {align: "center"},0,170);
    doc.myText(lines3, {align: "center"},0,175);
  //if (lines3 === lines4 ){doc.myText(lines3, {align: "center"},0,175)};

    doc.myText(booking,{align: "center"},0, 187);
    doc.myText(guest, {align: "center"},0, 205);
    doc.text(check_in,70,225);
    doc.text(check_out,118,225);
    doc.text(nigths,120,238);
    doc.myText(root_type, {align: "center"},125,255);
    doc.myText(info, {align: "center"},0,270);

    doc.save('hoteles.pdf');
}

function getRowValues(row) {

    let tbody = $('#tbody')[0].getElementsByTagName("tr")[row];
    console.log(tbody.length);
    var concierge = [];

    for (let i = 0; i < 9; i++) {
        let value = tbody.getElementsByTagName("td")[i].innerHTML;
        concierge.push(value);
    }

    //console.log(concierge);
    createPdf(concierge);
}

$(document).on('change', '.rows', function () {
    $('input[type="checkbox"]').not(this).prop('checked', false);
});

$(document).ready(function () {

  $('#generatePdf').click(function () {
        let rows = document.querySelectorAll('.rows');

        for (let i = 0; i < rows.length; i++) {
          if (rows[i].checked) {
              getRowValues($(rows[i]).attr('id'));
          }
        }
    });

});
